import React from 'react';

const TitleCard = () => {
    return (

        <div className="flex flex-col justify-items-center w-full mt-20">
            <div className="grid h-20 card bg-base-300 p-5 text-3xl font-bold rounded-box place-items-center">Cryptocurrency Converter Calculator</div>
            <div className="divider"></div>
            <div className="grid h-20 card bg-base-300 rounded-box place-items-center">
                <input type="text" placeholder="type amount" className="w-96 input input-bordered"/>
            </div>
        </div>
    );
}

export default TitleCard;
